import styled from 'styled-components';

export default styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    img {
        flex-basis: 30%;
        border: 1px solid black;
    }
    .partners-box {
        display: flex;
        width: 100vw;
        justify-content: space-around;
        flex-wrap: wrap;
    }
    #top {
        margin-bottom: 20px;
    }
    #banner {
        background-color: #00334A;
        width: 100%;
        height: 10vh;
        display: flex;
        justify-content: center;
        align-items: center;
        margin-bottom: 20px;
    }
    #banner-caption {
        color: white;
        font-size: 30px;
    }
`;
